class Solution {
public:
    int minMalwareSpread(vector<vector<int>>& graph, vector<int>& initial) {
        sort(initial.begin(), initial.end());

        int graph_size = graph.size();
        int final_minimum = INT_MAX;
        int final_delete = 0;

        for (int i = 0; i < initial.size(); ++i) {
            int cur_delete = initial[i];
            // change graph

            vector<bool> visited(graph_size, false);
            visited[cur_delete] = true;

            vector<int> v;
            int total_infected = 0;

            for (int j = 0; j < initial.size(); ++j) {
                if (visited[initial[j]]) {
                    continue;
                }
                v.push_back(initial[j]);

                while (v.size() != 0) {
                    int cur_infected = v[v.size() - 1];
                    v.pop_back();

                    if (visited[cur_infected]) {
                        continue;
                    }

                    ++total_infected;
                    visited[cur_infected] = true;

                    for (int n = 0; n < graph_size; ++n) {
                        if (!visited[n] && graph[cur_infected][n] == 1) {
                            v.push_back(n);
                        }
                    }
                    
                }
            }

            if (final_minimum > total_infected) {
                final_minimum = total_infected;
                final_delete = cur_delete;
            }
        }
        return final_delete;
    }
};

